"Change Set:		8017Collections-nice.170Collections-nice.170:Make keys answer an Array rather than a Set/IdentitySet/PluggableSetWARNING: cross your fingers..."!!Dictionary methodsFor: 'accessing' stamp: 'nice 10/20/2009 23:20'!keys	"Answer an Array containing the receiver's keys."		^Array new: self size streamContents: [:s| self keysDo: [:key| s nextPut: key]]! !!KeyedSet methodsFor: 'accessing' stamp: 'nice 10/20/2009 23:20'!keys	"Answer an Array containing the receiver's keys."		^Array new: self size streamContents: [:s| self keysDo: [:key| s nextPut: key]]! !PluggableDictionary removeSelector: #keys!IdentityDictionary removeSelector: #keys!